import style from "../styles/merchantsignup"
const Merchantsignup = () => {
    
    return ( 
        <form action="">

            <label htmlFor="">Name</label>
            <input placeholder="Enter The Name" required type="text" />
            <label htmlFor="">Gst_number</label>
            <input placeholder="Enter The Gst Number" required type="text" />
            <label htmlFor="">Email</label>
            <input type="email" placeholder="Enter The Email" required />
            <label htmlFor="">Phone No</label>
            <input type="tel" placeholder="Enter The  Phone"  required/>
            <label htmlFor="">password</label>
            <input type="password" placeholder="Enter The password" required />
            <button className="btn btn-outline-info">Submit</button>

        </form>
     );
}
 
export default Merchantsignup;
